import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 2.2-614.5 Electric vehicle charging stations.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-614.5.md","filePath":"vacode/2.2-614.5.md"}'),i={name:"vacode/2.2-614.5.md"},c=r('<h1 id="§-2-2-614-5-electric-vehicle-charging-stations" tabindex="-1">§ 2.2-614.5 Electric vehicle charging stations. <a class="header-anchor" href="#§-2-2-614-5-electric-vehicle-charging-stations" aria-label="Permalink to &quot;§ 2.2-614.5 Electric vehicle charging stations.&quot;">​</a></h1><p>Each agency, as defined in § <a href="/vacode/2.2-128/">2.2-128</a>, may locate and operate a retail fee-based electric vehicle charging station on any property or facility that such agency controls if the electric vehicle charging services are offered at prevailing market rates. For the purposes of this section, &quot;prevailing market rates&quot; means rates that include applicable taxes and are similar to those generally available to consumers in competitive areas for the same services.</p><p>2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0248" target="_blank" rel="noreferrer">248</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0490" target="_blank" rel="noreferrer">490</a>.</p>',3),o=[c];function n(s,l,h,_,g,p){return a(),t("div",null,o)}const v=e(i,[["render",n]]);export{f as __pageData,v as default};
